import React from 'react';
import "./coldChainWar.css";
import navLogo from "./navLogo.png"
import Nav from '../landingPage/Nav/navbar.js'
import blueLogo from "./blueLogo.png"
import dots from "./dots.png"




const ColdChainWar = () => {
	return(
		<div className=" flex fr">

			<div className=" ">	
				<Nav />
	      	</div>

	      	<div className="">
		      	<img className="bLogo " src={navLogo} alt="logo" />
		      	{/*<img className="bLogo " src={blueLogo} alt="logo" />*/}
	      	</div>

	      	<div className="dots">
	      		<img className=" " src={dots} alt="logo" />
	      	</div>


      	</div>
		)
}

export default ColdChainWar;
